import ChatList from '../ChatListFolder/ChatList';

function ChatParent(){
    return(
        <div>
            <ChatHeader />
          <div className="AppGrid">
            <ChatProfile />
            <ChatList />
            <ChatBody />
          </div>
          
        </div>
    )
}

export default ChatParent;
